(32, 1, '2023-02-27 16:06:35', '2023-02-27 16:06:35', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost:3000/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Products', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2023-02-27 16:06:35', '2023-02-27 16:06:35', '', 2, 'http://localhost:3000/?p=32', 0, 'revision', '', 0),
(33, 1, '2023-02-27 16:08:11', '2023-02-27 16:08:11', '<!-- wp:columns {\"verticalAlignment\":null} -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:gutena/forms {\"formID\":\"gutena_forms_ID_0c3149bb4d_132023215825\",\"formClasses\":\"gutena-forms-contact-form gutena_forms_ID_0c3149bb4d_132023215825 input-box-border-bottom-only after_submit_message\",\"inputBottomBorderOnly\":true,\"adminEmails\":\"cjustinobi@gmail.com\",\"formStyle\":\" .gutena-forms-contact-form {\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dplaceholder-color:#808080;\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dinput-bg-color:transparent;\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dlabel-font-size:1rem;\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dlabel-line-height:;\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dlabel-font-weight:400;\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dplaceholder-font-size:13px;\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dplaceholder-line-height:;\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dplaceholder-font-weight:400;\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dinput-border-width:1px;\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dgutena-forms\\u002d\\u002dinput-border-radius:0px;\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\n\\t\\t\\t\\t\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002dblock-gap:2rem;\\n\\t\\t\\t}\\n\\n\\t\\t\\t\\n\\t\\t\\t.editor-styles-wrapper .gutena-forms-contact-form \\u003e .block-editor-inner-blocks \\u003e .block-editor-block-list__layout \\u003e * + * {\\n\\t\\t\\t\\t\\t\\tmargin-block-start: 2rem;\\n\\t\\t\\t\\t\\t\\tmargin-block-end: 0;\\n\\t\\t\\t\\t\\t}\\n\\t\\t\\t\\t\\t\\n\\t\\t\\t\\n\\n\\t\\t\\