(148, 1, '2023-03-04 13:59:04', '2023-03-04 13:59:04', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:html -->\n<h1>Who We Are</h1>\n    <p>\n      Egry Engineering Limited is a wholly indigenous company formed by experienced Chemists and Engineers,\n      with the primary focus of providing services of instrument sales, repairs and calibration of electronic\n      and electromechanical equipment.\n    </p>\n\n    <p>\n      Our strategy is simply to provide top quality instrumentation, coupled\n      with excellent pre-sales and after-sales support services on a multi-vendor and multi-instrument\n      platform. Our approach is always customer-oriented; and the goal is customer satisfaction.\n      As a mid-size personally led company, we are able to compete favorably against major competitors\n      without compromising the quality of our products and services. Our solutions and services are\n      customized and personalized to the requirements of each and every customer.\n    </p>\n    <button class=\"btn accent-bg\">Read More</button>\n<!-- /wp:html --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:image {\"id\":83,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:3000/wp-content/uploads/2023/03/about1.png\" alt=\"\" class=\"wp-image-83\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"align\":\"center\",\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"http://localhost:3000/wp-content/uploads/2023/03/about2.png\" alt=\"\" class=\"wp-image-84\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<h1>Our Vision</h1>\n<p>Our vision is to be the foremost chemical analysis and engineering solutions provider of reference in Nigeria and West Africa.</p>\n<p>We want to provide top quality chemical analysis solutions and laboratory instrumentation coupled with excellent pre-sales and after-sales technical support services on a multi-instrument and multi-vendor platform.</p>\n<!-- /wp:html --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:html -->\n<h1>Our People</h1>\n    <p>\n     Egry Engineering Limited provides good working condition for all our employees. We have a comprehensive employee benefit. We believe this will enhance productivity and advance our employees development.\nWe are passionate and committed to achieving the goal of the local content policy. We provide various comprehensive training programs aimed at capacity building and manpower development for our local managerial and top management staff to achieve the goals of the local content initiatives.</p><p>\nEgry Engineering Limited, its directors and its shareholders are committed to providing the Nigerian energy industry with the necessary personnel training that meets industry standards according to our customers work scope and specifications.</p>\n<!-- /wp:html --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\"><!-- wp:image {\"id\":83,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost:3000/wp-content/uploads/2023/03/about1.png\" alt=\"\" class=\"wp-image-83\"/></figure>\n<!-- 